import React from 'react';
import './App.css';
import { Header } from './views/components/Header';
import { HashRouter, Routes } from 'react-router-dom';

function App() {
  return (
    <HashRouter>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </HashRouter>
  );
}

export default App;
